import React, { Component } from 'react';
import Todos from './components/Todos';

import './App.css';

class App extends Component {

  state = {
    todos: [
      {
        id: 1,
        title: 'Learn React JS',
        completed: false
      },
      {
        id: 2,
        title: 'Develop projects using React JS',
        completed: false
      },
      {
        id: 3,
        title: 'Push on GitHub',
        completed: false
      }
    ]
  }


  render() {
    console.log(this.state.todos)
    return (
      <div className="App">
        <Todos />
      </div>
    );
  }
}

export default App;
